import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

import Home from './containers/Home';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home  />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
